window.bookSummaryJSON = "<p>Magic is fading, and humanity is at the brink of extinction.</p> <p>Sybil lived and breathed the life of a miner, delving deep into monster-infested caverns and perilous shafts, risking her life to unearth Relics of an ancient past for food and shelter. That is until one day, she discovers a Relic that would change her fate from a simple miner to an Ascended—a Relic that connected her to the magic that was once lost.</p> <p>[You have acquired the aspect of Fallen Flames.]</p> <p>A Relic that gave her freedom.</p>"; 
